class Scrollable(ttk.Frame):
    """
      使用右侧的滚动条使框架可滚动。在可滚动框架中添加或删除小部件之后，调用update（）方法刷新可滚动区域
    """

    def __init__(self, frame, width=16):
        scrollbar = ttk.Scrollbar(frame, width=width, orient="vertical")
        scrollbar.pack(side=tk.RIGHT, fill=tk.Y, expand=False)

        self.canvas = tk.Canvas(
            frame,
            yscrollcommand=scrollbar.set,
            width=500,
            height=360)
        self.canvas.pack(side=tk.LEFT, fill=tk.BOTH, expand=True)

        scrollbar.config(command=self.canvas.yview)

        self.canvas.bind('<Configure>', self.__fill_canvas)

        # base class initialization
        ttk.Frame.__init__(self, frame)

        # assign this obj (the inner frame) to the windows item of the canvas
        self.windows_item = self.canvas.create_window(
            0, 0, window=self, anchor=tk.NW)

        l = self.init_generator(init_val)

        for num, i in enumerate(l):
            Add_Del_Row(self).add_row(name=i, types=num)

    def __fill_canvas(self, event):
        "Enlarge the windows item to the canvas width"

        canvas_width = event.width
        self.canvas.itemconfig(self.windows_item, width=canvas_width)

    def init_generator(self, l):
        for i in init_val:
            yield i

    def update(self):
        "Update the canvas and the scrollregion"

        self.update_idletasks()
        self.canvas.config(scrollregion=self.canvas.bbox(self.windows_item))


