class Add_Del_Row(object):

    def __init__(self, scrollable_body):
        self.scrollable_body = scrollable_body

    def add_row(self, name='', types=None):

        global i
        i = i + 1
        items = []
        l = ttk.Label(self.scrollable_body, text=i)
        items.append(l)
        field = ttk.Entry(
            self.scrollable_body, font=(
                'Weibei TC', 20), width=15)
        field.insert(0, name)
        type = ttk.Combobox(
            self.scrollable_body,
            font=(
                'STFangsong',
                20),
            width=16,
            state='readonly',
            values=type_list)
        if types is not None:
            type.current(types)
        clear = ttk.Button(
            self.scrollable_body,
            text='Clear',
            width=4,
            command=lambda: self.clear_one_row_txt(
                l.cget('text')))
        pop = ttk.Button(
            self.scrollable_body,
            text='X',
            width=2,
            command=lambda: self.delete_row(
                l.cget('text')))
        items.append(field)
        items.append(type)
        items.append(clear)
        items.append(pop)
        field.grid(row=i, column=1, pady=8)
        type.grid(row=i, column=2, padx=10)
        clear.grid(row=i, column=3)
        pop.grid(row=i, column=4, padx=8)
        self.scrollable_body.update()
        rows.append(items)

    def delete_row(self, lab):
        for rowno, row in reversed(list(enumerate(rows))):
            if row[0].cget("text") == lab:
                for i in row:
                    i.destroy()
                    self.scrollable_body.update()
                rows.pop(rowno)

    def clear_one_row_txt(self, lab):
        for rowno, row in reversed(list(enumerate(rows))):
            if row[0].cget("text") == lab:
                row[1].delete(0, END)
                row[2].set('')
                self.scrollable_body.update()
                # rows.pop(rowno)

    def delete_all_row(self):
        for rowno, row in reversed(list(enumerate(rows))):
            for i in row:
                i.destroy()
            rows.pop(rowno)

    def down_data_save_file(self, total, type_f):

        save_dict = {}
        for row in rows:
            fieled_name = row[1].get()
            type_name = row[2].get()
            if fieled_name and type_name:
                if save_dict.get(fieled_name):
                    messagebox.showwarning(
                        title="Waring", message="""Column "{}" is specified more than once.
                                                                   Column names must be unique.""".format(fieled_name))
                    return
                save_dict[fieled_name] = type_name
        if save_dict == {}:
            messagebox.showwarning(title='Warning',
                                   message="""请输入有效字段/Enter Correct column""")
            return

        total_row_num = total.get()
        status = val[-1].state()

        file_type = type_f.get()

        try:
            if int(total_row_num) > 0:
                if file_type == 'JSON':
                    if len(status) > 0:
                        File("MOCK_DATA", fake_lan).save_data_json(
                            total_row_num, save_dict, status=True)  # 保存为json
                    else:
                        File('MOCK_DATA', fake_lan).save_data_json(
                            total_row_num, save_dict, status=False)
                elif file_type == 'SQL':
                    table_name, _table_status = val[1].get(), status
                    if len(_table_status) > 0:
                        File(table_name, fake_lan).create_table_and_open_sql(
                            total_row_num, save_dict, status=True)
                    else:
                        File(table_name, fake_lan).create_table_and_open_sql(
                            total_row_num, save_dict, status=False)

            else:
                messagebox.showwarning(
                    title='警告', message='请输入有效数字')

        except ValueError as e:
            messagebox.showwarning(
                title='错误', message='"{}"是无效字符'.format(total_row_num))

class Func_Data(object):
    def __init__(self, frame):
        self.frame = frame
        self.add_row_and_type()

    def add_row_and_type(self):
        # ---------Rows Num:-----------
        ttk.Label(
            self.frame,
            text='Rows Num:',
            font=(
                "times new roman",
                20,
                'bold'),
            foreground='#ED7860') .grid(
            row=1,
            column=1,
            padx=10)
        row_num = ttk.Entry(Frame4, font=('times new roman', 22), width=10)
        row_num.insert(0, 1000)
        row_num.grid(row=1, column=2, padx=4)
        # ----------Format--------------
        ttk.Label(
            self.frame,
            text='Format Type:',
            font=(
                "times new roman",
                20,
                'bold'),
            foreground='#ED7860') .grid(
            row=1,
            column=3,
            padx=5)
        select_file_type = ttk.Combobox(
            self.frame,
            font=(
                'times new roman',
                15),
            state='readonly',
            justify=CENTER,
            width=15)
        select_file_type['values'] = ('JSON', 'SQL', 'CSV', 'Cassandra CQL')
        select_file_type.grid(row=1, column=4, padx=5)
        select_file_type.current(0)
        select_file_type.bind(
            '<<ComboboxSelected>>',
            lambda event: self.callback(
                select_file_type,
                event))
        return row_num, select_file_type

    def add_json_status(self):
        # ---------JSQN-------------------
        json_status = self.model_status('array', 1, 5, 10)
        val.append(json_status)

    def model_status(self, text, row, column, padx):
        var = IntVar()
        status = ttk.Checkbutton(self.frame, text=text, variable=var)
        status.val = var
        status.state(['selected'])
        status.grid(row=row, column=column, padx=padx)
        return status

    def add_sql_status(self):
        # -----------SQL------------------
        tab_name = ttk.Label(
            self.frame,
            text='Table Name:',
            font=(
                "times new roman",
                20,
                'bold'),
            foreground='#ED7860')
        tab_name.grid(row=2, column=1, pady=5)
        name = ttk.Entry(self.frame, font=('times new roman', 22), width=10)
        name.insert(0, 'mock_data')
        name.grid(row=2, column=2, pady=10)
        sql_status = self.model_status('include create table', 2, 3, 5)
        val.append(tab_name)
        val.append(name)
        val.append(sql_status)

    def callback(self, select_file_type, event):

        one_status = select_file_type.get()
        if one_status == "JSON":
            self.remove_widget(val)
            self.add_json_status()
        elif one_status == "SQL":
            self.remove_widget(val)
            self.add_sql_status()

    def remove_widget(self, val):
        for num, i in reversed(list(enumerate(val))):
            i.destroy()
            val.pop(num)


